import styled from "react-emotion";

export default styled("navbar")`
  width: 100%;
  padding: 16px;
  background-color: white;
  display: flex;
  box-shadow: 0 0 18px 0 rgba(42, 51, 83, 0.12);
  position: fixed;
  font-weight: 600;
  z-index: 20;
`;
